function loadDirectory(){const n=$("#blog_asp_page").val();$.ajax({type:"POST",url:`/Blog/${n}?handler=ShowDirectory`,beforeSend:function(n){n.setRequestHeader("XSRF-TOKEN",$('input:hidden[name="__RequestVerificationToken"]').val())}}).done(function(n){$("#blog_directory_container").html(n)})}$(document).ready(function(){loadDirectory()});